import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import Playlists from './Javascript/Playlists';
import App from './Javascript/App';
import AuthWrapper from './AuthWrapper';

function MainRouter() {
  return (
    <Router>
      <AuthWrapper>
        <Routes>
          <Route path="/home" element={<AppWithNav />} />
          <Route path="/jammming" element={<AppWithNav />} />
          <Route path="/playlists" element={<PlaylistsWithNav />} />
          <Route path="/" element={<Navigate to="/home" replace />} />
        </Routes>
      </AuthWrapper>
    </Router>
  );
}

function AppWithNav() {
  return (
    <>
      <header className="App-header" style={{display:'flex',alignItems:'center',justifyContent:'space-between',padding:'1rem 2rem',background:'#fff',borderBottom:'1px solid #eee'}}>
        <h1 style={{margin:0}}>Ja<span className="purple">mmm</span>ing</h1>
        <nav>
          <Link to="/home" style={{marginRight: 20, textDecoration: 'none', color: '#333', fontWeight:'bold'}}>Jammming</Link>
          <Link to="/playlists" style={{textDecoration: 'none', color: '#333', fontWeight:'bold'}}>Playlists</Link>
        </nav>
      </header>
      <App />
    </>
  );
}

function PlaylistsWithNav() {
  return (
    <>
      <header className="App-header" style={{display:'flex',alignItems:'center',justifyContent:'space-between',padding:'1rem 2rem',background:'#fff',borderBottom:'1px solid #eee'}}>
        <h1 style={{margin:0}}>Ja<span className="purple">mmm</span>ing</h1>
        <nav>
          <Link to="/home" style={{marginRight: 20, textDecoration: 'none', color: '#333', fontWeight:'bold'}}>Jammming</Link>
          <Link to="/playlists" style={{textDecoration: 'none', color: '#333', fontWeight:'bold'}}>Playlists</Link>
        </nav>
      </header>
      <Playlists />
    </>
  );
}

export default MainRouter;
